import React, { useEffect, useState } from 'react';
import { 
    Dialog, 
    DialogTitle, 
    DialogContent, 
    DialogActions, 
    Button, 
    Typography, 
    Box,
    List,
    ListItem,
    ListItemText,
    CircularProgress
} from '@mui/material';
import socketIOClient from 'socket.io-client';

const TestConnection = ({ open, onClose }) => {
    const [apiStatus, setApiStatus] = useState(null);
    const [socketStatus, setSocketStatus] = useState('disconnected');
    const [messages, setMessages] = useState([]);
    const [socket, setSocket] = useState(null);
    const [isLoading, setIsLoading] = useState(true);
    const [streamingContent, setStreamingContent] = useState('');
    const [isSending, setIsSending] = useState(false);

    useEffect(() => {
        // Test HTTP endpoint
        const testApiConnection = async () => {
            try {
                setIsLoading(true);
                const response = await fetch('http://localhost:5000/api/test_connection');
                const data = await response.json();
                setApiStatus(data);
            } catch (error) {
                setApiStatus({ status: 'error', message: error.message });
            } finally {
                setIsLoading(false);
            }
        };

        // Initialize Socket.IO connection
        const socket = socketIOClient('http://localhost:5000');
        setSocket(socket);

        socket.on('connect', () => {
            setSocketStatus('connected');
            console.log('Socket.IO connected');
        });

        socket.on('disconnect', () => {
            setSocketStatus('disconnected');
            console.log('Socket.IO disconnected');
        });

        // Handle message chunks
        socket.on('message_chunk', (data) => {
            console.log('Message chunk received:', data);
            setStreamingContent(prev => {
                const newContent = prev + (data.chunk || '');
                console.log('Updated streaming content:', newContent);
                return newContent;
            });
        });

        // Handle message completion
        socket.on('message_complete', (data) => {
            console.log('Message complete received:', data);
            // Add the streaming content as a plain text message
            setMessages(prev => {
                const newMessages = [...prev, { content: streamingContent }];
                console.log('Updated messages:', newMessages);
                return newMessages;
            });
            setStreamingContent('');
            setIsSending(false);
        });

        testApiConnection();

        return () => {
            socket.disconnect();
        };
    }, []);

    const sendTestMessage = () => {
        if (socket) {
            setIsSending(true);
            setStreamingContent(''); // Clear previous content
            socket.emit('test_message', {
                session_id: 'test_session',
                message: 'Hello from client!'
            });
        }
    };

    return (
        <Dialog open={open} onClose={onClose} maxWidth="md" fullWidth>
            <DialogTitle>Connection Test</DialogTitle>
            <DialogContent>
                <Box sx={{ mb: 3 }}>
                    <Typography variant="h6" gutterBottom>HTTP API Status:</Typography>
                    {isLoading ? (
                        <CircularProgress size={24} />
                    ) : (
                        <pre style={{ 
                            backgroundColor: '#f5f5f5', 
                            padding: '10px', 
                            borderRadius: '4px',
                            overflow: 'auto'
                        }}>
                            {JSON.stringify(apiStatus, null, 2)}
                        </pre>
                    )}
                </Box>

                <Box sx={{ mb: 3 }}>
                    <Typography variant="h6" gutterBottom>Socket.IO Status: {socketStatus}</Typography>
                    <Button 
                        variant="contained" 
                        onClick={sendTestMessage} 
                        disabled={socketStatus !== 'connected' || isSending}
                        sx={{ mt: 1 }}
                    >
                        {isSending ? 'Sending...' : 'Send Test Message'}
                    </Button>
                </Box>

                {streamingContent && (
                    <Box sx={{ mb: 3 }}>
                        <Typography variant="h6" gutterBottom>Streaming Response:</Typography>
                        <pre style={{ 
                            backgroundColor: '#f5f5f5', 
                            padding: '10px', 
                            borderRadius: '4px',
                            overflow: 'auto'
                        }}>
                            {streamingContent}
                        </pre>
                    </Box>
                )}

                <Box>
                    <Typography variant="h6" gutterBottom>Received Messages:</Typography>
                    <List>
                        {messages.map((msg, index) => (
                            <ListItem key={index}>
                                <ListItemText
                                    primary={
                                        <pre style={{ 
                                            backgroundColor: '#f5f5f5', 
                                            padding: '10px', 
                                            borderRadius: '4px',
                                            overflow: 'auto'
                                        }}>
                                            {msg.content}
                                        </pre>
                                    }
                                />
                            </ListItem>
                        ))}
                    </List>
                </Box>
            </DialogContent>
            <DialogActions>
                <Button onClick={onClose}>Close</Button>
            </DialogActions>
        </Dialog>
    );
};

export default TestConnection;
